import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 3.2-6566 Preventing cruelty to animals; interference; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-6566.md","filePath":"vacode/3.2-6566.md"}'),n={name:"vacode/3.2-6566.md"},i=a('<h1 id="§-3-2-6566-preventing-cruelty-to-animals-interference-penalty" tabindex="-1">§ 3.2-6566 Preventing cruelty to animals; interference; penalty. <a class="header-anchor" href="#§-3-2-6566-preventing-cruelty-to-animals-interference-penalty" aria-label="Permalink to &quot;§ 3.2-6566 Preventing cruelty to animals; interference; penalty.&quot;">​</a></h1><p>Each animal control officer, humane investigator or State Veterinarian&#39;s representative shall interfere to prevent the perpetration of any act of cruelty upon any animal in his presence. Any person who shall interfere with or obstruct or resist any humane investigator or State Veterinarian&#39;s representative in the discharge of his rights, powers, and duties as authorized and prescribed by law is guilty of a Class 4 misdemeanor.</p><p>1984, c. 492, § 29-213.80; 1986, c. 362; 1987, c. 488, § 3.1-796.111; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0817" target="_blank" rel="noreferrer">817</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0240" target="_blank" rel="noreferrer">240</a>.</p>',3),o=[i];function s(l,c,p,_,f,h){return t(),r("div",null,o)}const u=e(n,[["render",s]]);export{g as __pageData,u as default};
